(function(){$.widget("execut.MassDeleteForm",{_progressBarEl:null,_submitButtons:null,_create:function(){var a=this;a._initElements();a._initEvents()},_initElements:function(){var a=this,b=a.element;a._progressBarEl=b.find(".progress-bar");a._errorsEl=b.find(".delete-errors");if(a._progressBarEl.length){a._updateProgressBar()}},_initEvents:function(){var a=this,b=a.element},_updateProgressBar:function(){var a=this;$.get(location.href+"&getProgress=1",function(b){if(b.progress===100){location.href=location.href}else{a._errorsEl.html(b.errors);a._progressBarEl.css("width",b.progress+"%");setTimeout(function(){a._updateProgressBar()},1000)}})}})})();